import Header from "./components/Header";
import Footer from "./components/Footer";
//import { Container, Row, Col } from "react-bootstrap";
function App() {
  return (
    <div className="App">
      <Header />
      <main>
        <Container>
          <h1>Welcome to ProShop</h1>
        </Container>
      </main>
      <Footer />
    </div>
  );
}

export default App;
